import React from "react";
import "./App.css";

import Headline from "./components/Headline/Headline";
import Latest from "./components/Latest/Latest";
import Hub from "./components/Hub/Hub";
import Story from "./components/Story/Story";
import Byline from "./components/Byline/Byline";

const App = () => {
    return (
        <div className="App">
            <Headline></Headline>
            <Latest
                image="yang.jpg"
                header="This is a header"
                content="Lorem ipsum dolor sit amet consectetur adipisicing elit. Sunt consectetur rem doloribus asperiores amet magni quasi, unde nostrum eligendi porro!"
                articleLink="http://poop.com/"
            ></Latest>
            <Hub></Hub>
            <Story image="yang.jpg">
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Illum
                necessitatibus ea hic libero fugit minima temporibus sint
                distinctio quasi impedit.
            </Story>
            <Byline logo="logo.png" image="yang.jpg"></Byline>
        </div>
    );
};

export default App;
